import React from 'react';
import { Link } from 'react-router-dom';
import { motion } from 'framer-motion';

function Navbar() {
  return (
    <nav className="bg-purple-600 bg-opacity-90 backdrop-filter backdrop-blur-lg text-white p-4 fixed w-full z-10">
      <div className="container mx-auto flex justify-between items-center">
        <Link to="/" className="text-2xl font-bold">TokTok</Link>
        <div className="space-x-4">
          <motion.div whileHover={{ scale: 1.1 }} whileTap={{ scale: 0.95 }} className="inline-block">
            <Link to="/login" className="hover:text-blue-200 transition duration-300">Login</Link>
          </motion.div>
          <motion.div whileHover={{ scale: 1.1 }} whileTap={{ scale: 0.95 }} className="inline-block">
            <Link to="/register" className="hover:text-blue-200 transition duration-300">Register</Link>
          </motion.div>
        </div>
      </div>
    </nav>
  );
}

export default Navbar;
